      <p>CSS+SASS</p>
      <p>SEO naturel</p>
      <p>JavaScript</p>
      <p>MAGE</p>
      <p>THIEF</p>
      <p>WARRIOR</p>
      <p>MONK</p>
      <p>MAGE</p>
      <p>THIEF</p>
      <p>WARRIOR</p>
      <p>MONK</p>
      <p>MAGE</p>
      <p>THIEF</p>
      <p>WARRIOR</p>
      <p>MONK</p>
    </div>
  );
}

export default Competences;
